import { useState } from "react";
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Typography,
  TextField,
  Box,
  Grid,
  Checkbox,
  FormControlLabel
} from "@mui/material";
import { useNavigate } from "react-router-dom";

export default function ModalStart({ open, onClose }) {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nombres: "",
    apellidos: "",
    dni: "",
    email: "",
    celular: "",
    terms: false
  });
  const [error, setError] = useState("");

  const handleChange = (e) => {
    const value = e.target.type === 'checkbox' ? e.target.checked : e.target.value;
    setForm({ ...form, [e.target.name]: value });
    setError("");
  };

  const handleStart = () => {
    if (!form.nombres || !form.apellidos || !form.dni || !form.email || !form.celular) {
      setError("Completa todos los campos obligatorios.");
      return;
    }

    if (!form.terms) {
      setError("Debes aceptar las pol√≠ticas de privacidad.");
      return;
    }

    navigate("/test");
  };

  return (
    <Dialog 
      open={open} 
      onClose={onClose}
      maxWidth="md"
      fullWidth
      PaperProps={{
        sx: {
          borderRadius: 3,
          overflow: 'visible',
          background: 'linear-gradient(135deg, #ffffff 0%, #f5f5f5 100%)',
        }
      }}
    >
      {/* Header con imagen y t√≠tulo */}
      <Box sx={{ position: 'relative', textAlign: 'center', pt: 4 }}>
        <Box
          component="img"
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRRJBmRAPLWtq23-HDm-34Y2F2xoLDKzHBXWg&s"
          alt="Test Vocacional"
          sx={{
            width: 120,
            height: 120,
            borderRadius: '50%',
            objectFit: 'cover',
            border: '4px solid #4caf50',
            boxShadow: '0 4px 8px rgba(0,0,0,0.2)',
            position: 'absolute',
            top: -60,
            left: '50%',
            transform: 'translateX(-50%)',
            backgroundColor: 'white'
          }}
        />
        <DialogTitle sx={{ 
          color: "#2e7d32", 
          textAlign: 'center',
          pt: 8,
          pb: 1
        }}>
          <Typography variant="h4" fontWeight="bold" gutterBottom>
            Test Vocacional
          </Typography>
          <Typography variant="h5" fontWeight="medium" color="#388e3c" gutterBottom>
            Visualizate
          </Typography>
          <Typography variant="subtitle1" color="text.secondary">
            Descubre tu carrera ideal
          </Typography>
        </DialogTitle>
      </Box>

      <DialogContent sx={{ p: 4 }}>
        <Typography 
          variant="h5" 
          fontWeight="bold" 
          color="#1b5e20" 
          align="center"
          gutterBottom
          sx={{ mb: 3 }}
        >
          Queremos conocerte
        </Typography>

        <Grid container spacing={2}>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Nombres*"
              name="nombres"
              value={form.nombres}
              onChange={handleChange}
              fullWidth
              size="medium"
              variant="outlined"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Apellidos*"
              name="apellidos"
              value={form.apellidos}
              onChange={handleChange}
              fullWidth
              size="medium"
              variant="outlined"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="DNI*"
              name="dni"
              value={form.dni}
              onChange={handleChange}
              fullWidth
              size="medium"
              variant="outlined"
              inputProps={{ maxLength: 8 }}
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Email*"
              name="email"
              value={form.email}
              onChange={handleChange}
              fullWidth
              size="medium"
              variant="outlined"
              type="email"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              label="Celular*"
              name="celular"
              value={form.celular}
              onChange={handleChange}
              fullWidth
              size="medium"
              variant="outlined"
              inputProps={{ maxLength: 9 }}
            />
          </Grid>
        </Grid>

        <FormControlLabel
          control={
            <Checkbox 
              name="terms" 
              checked={form.terms} 
              onChange={handleChange}
              sx={{ 
                color: "#4caf50",
                '&.Mui-checked': {
                  color: "#388e3c",
                },
              }}
            />
          }
          label="Acepto las pol√≠ticas de privacidad"
          sx={{ mt: 3, display: 'block' }}
        />

        {error && (
          <Typography color="error" variant="body2" sx={{ mt: 2 }}>
            {error}
          </Typography>
        )}
      </DialogContent>

      <DialogActions sx={{ p: 4, pt: 0 }}>
        <Button
          variant="contained"
          onClick={handleStart}
          fullWidth
          size="large"
          sx={{ 
            backgroundColor: "#4caf50",
            color: "white",
            fontWeight: "bold",
            py: 2,
            fontSize: '1.1rem',
            borderRadius: 2,
            boxShadow: '0 4px 8px rgba(76, 175, 80, 0.3)',
            '&:hover': {
              backgroundColor: "#388e3c",
              boxShadow: '0 6px 12px rgba(56, 142, 60, 0.4)',
            }
          }}
        >
          INICIAR TEST
        </Button>
      </DialogActions>
    </Dialog>
  );
}
